-- ----------------------------
-- View structure for v_incidence
-- ----------------------------
DROP VIEW IF EXISTS `v_incidence`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_incidence` AS select distinct (select group_concat(concat(`user`.`name`,' ',`user`.`lastname`) separator '-') from (`assignment` join `user` on((`user`.`id` = `assignment`.`user`))) where (`assignment`.`ticket` = `incidence`.`ticket`)) AS `responsables`,`incidence`.`id` AS `id`,concat(`user`.`name`,' ',`user`.`lastname`) AS `user`,date_format(`incidence`.`date`,'%d-%m-%Y') AS `date`,cast(`incidence`.`date` as time) AS `time`,`incidence`.`ticket` AS `ticket`,`incidence`.`description` AS `description`,`incidence`.`isClosed` AS `isClosed` from ((`incidence` join `user` on((`incidence`.`user` = `user`.`id`))) join `assignment` on((`assignment`.`user` = `user`.`id`))) ;

-- ----------------------------
-- View structure for v_ticket
-- ----------------------------
DROP VIEW IF EXISTS `v_ticket`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_ticket` AS select (select group_concat(concat(' ',`user`.`name`,' ',`user`.`lastname`) separator ',') from (`assignment` join `user` on((`user`.`id` = `assignment`.`user`))) where (`assignment`.`ticket` = `ticket`.`id`)) AS `responsables`,`ticket`.`id` AS `id`,`ticket`.`type` AS `type`,`ticket`.`priority` AS `priority`,(select count(0) from `pause` where (isnull(`pause`.`datefinish`) and (`pause`.`ticket` = `ticket`.`id`))) AS `pause`,`priority`.`name` AS `name`,`ticket`.`user` AS `user`,`ticket`.`description` AS `description`,`ticket`.`state` AS `state`,`client`.`dni` AS `dni`,`client`.`name` AS `client`,date_format(`ticket`.`date`,'%Y-%m-%d') AS `date`,cast(`ticket`.`date` as time) AS `time`,concat(`user`.`name`,' ',`user`.`lastname`) AS `username`,`type`.`name` AS `tipo`,`ticket`.`subject` AS `subject`,`state`.`name` AS `stateName` from (((((`ticket` join `priority` on((`ticket`.`priority` = `priority`.`id`))) join `client` on((`ticket`.`client` = `client`.`id`))) join `user` on((`ticket`.`user` = `user`.`id`))) join `type` on((`ticket`.`type` = `type`.`id`))) join `state` on((`ticket`.`state` = `state`.`id`))) ;

-- ----------------------------
-- View structure for v_ticket2
-- ----------------------------
DROP VIEW IF EXISTS `v_ticket2`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_ticket2` AS select `ticket`.`id` AS `ids`,(select group_concat(`user`.`email` separator ',') from (`assignment` join `user` on((`user`.`id` = `assignment`.`user`))) where (`assignment`.`ticket` = `ids`)) AS `responsables`,`ticket`.`type` AS `type`,`ticket`.`priority` AS `priority`,`priority`.`name` AS `name`,`ticket`.`user` AS `user`,`ticket`.`description` AS `description`,`ticket`.`state` AS `state`,`client`.`dni` AS `dni`,`client`.`name` AS `client`,date_format(`ticket`.`date`,'%Y-%m-%d') AS `date`,cast(`ticket`.`date` as time) AS `time`,`user`.`email` AS `useremail`,`client`.`email` AS `clientemail`,concat(`user`.`name`,' ',`user`.`lastname`) AS `username`,`type`.`name` AS `tipo`,`ticket`.`subject` AS `subject`,`state`.`name` AS `stateName` from (((((`ticket` join `priority` on((`ticket`.`priority` = `priority`.`id`))) join `client` on((`ticket`.`client` = `client`.`id`))) join `user` on((`ticket`.`user` = `user`.`id`))) join `type` on((`ticket`.`type` = `type`.`id`))) join `state` on((`ticket`.`state` = `state`.`id`))) ;

-- ----------------------------
-- View structure for v_time
-- ----------------------------
DROP VIEW IF EXISTS `v_time`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_time` AS select `ticket`.`id` AS `id`,`ticket`.`client` AS `client`,`ticket`.`date` AS `open`,(select `incidence`.`date` from `incidence` where ((`incidence`.`ticket` = `ticket`.`id`) and (`incidence`.`description` = 'Ha finalizado el ticket'))) AS `close`,ifnull(sec_to_time(timestampdiff(SECOND,`ticket`.`date`,(select `incidence`.`date` from `incidence` where ((`incidence`.`ticket` = `ticket`.`id`) and (`incidence`.`description` = 'Ha finalizado el ticket'))))),sec_to_time(0)) AS `time`,ifnull((select sec_to_time(sum(timestampdiff(SECOND,`pause`.`datestart`,`pause`.`datefinish`))) from `pause` where (`pause`.`ticket` = `ticket`.`id`) group by `pause`.`ticket`),sec_to_time(0)) AS `pause`,ifnull(sec_to_time((timestampdiff(SECOND,`ticket`.`date`,(select `incidence`.`date` from `incidence` where ((`incidence`.`ticket` = `ticket`.`id`) and (`incidence`.`description` = 'Ha finalizado el ticket')))) - (select sum(timestampdiff(SECOND,`pause`.`datestart`,`pause`.`datefinish`)) from `pause` where (`pause`.`ticket` = `ticket`.`id`) group by `pause`.`ticket`))),sec_to_time(0)) AS `total`,`client`.`dni` AS `dni`,`client`.`name` AS `name`,`state`.`name` AS `statename` from ((`ticket` join `client` on((`ticket`.`client` = `client`.`id`))) join `state` on((`ticket`.`state` = `state`.`id`))) ;

-- ----------------------------
-- View structure for v_user
-- ----------------------------
DROP VIEW IF EXISTS `v_user`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `v_user` AS select `user`.`id` AS `value`,concat(`user`.`name`,' ',`user`.`lastname`) AS `text` from `user` ;
